import PublicRoute from "./public";

const NavRoutes = () => {
  // const isLogin = useSelector(e => e?.userAuth?.login);
  // const jwt = useSelector(e => e?.userAuth?.jwt);
  const isLogin = true;
  const jwt = "vcadhcvznmv";
  if (isLogin && jwt) {
    return <PrivateRoute />;
  } else {
    return <PublicRoute />;
  }
};

export default NavRoutes;
